import React from 'react';
import Grid from './react/modules/grid';
import Controls from './react/modules/controls';
import "./css/app.css";
import "./css/card.css"

function App() {
  return (
    <div className="app">
      <div className="card">
        <h2>Path Finding Algorithm Visualizer</h2>
        <p>Hello! Welcome to my path finding visualizer. The point of this app is to calculate the most efficient path from the starting point to the ending point.</p>
        <p>Imagine you are a driver for a ride share company. You wouldn't want to be driving in circles trying to get to your final destination, right?</p>
      </div>
      <div className="card">
        <Grid></Grid>
        <Controls></Controls>
      </div>
    </div>
  );
}

export default App;
